#[macro_use]
extern crate virtual_dom_rs; // Percy supports events, classes, attributes a virtual dom
// with diff/patch and everything else that you'd expect from
// a frontend toolkit.
//
// This, however, is just the most basic example of rendering
// some HTML on the server side.
fn main () { let some_component = html! { <div class="cool-component",>{ "Hello World" }</div> }; let html_string = some_component.to_string(); println!("{}", html_string);
}
